	(6134,'_archive_homes_content_block','<h2>BesT-In-class</h2>\r\nThree exemplary builders are entrusted with building Artesia at Heritage Pointe luxury homes — Augusta Fine Homes, Brookfield Residential and Homes By Avi. All three are multiple award-winners for their quality work, but more importantly, each reflects the same commitment to value, craftsmanship, and design that is fundamental at Artesia.','no'),
	(6135,'_archive_homes_home_tiles_content_block','<h2>Visit a Showhome</h2>\r\nHomes starting from the $800\'s including lot and gst.','no'),
	(6136,'_archive_homes_legend_level_trans','Flat lot with a grade adjustment on one side.','no'),
	(6137,'_archive_homes_legend_walkout_lot','Low enough grade at the rear of the lot so you are able to walk directly out of your lower level into your back yard. It makes a two storey home feel like a three storey home.','no'),
	(6138,'_archive_homes_legend_walkout_trans','A walk-out lot with a grade adjustment on one side.','no'),
	(6139,'_archive_homes_legend_sunshine','A Sunshine basement lot is where rather than a walkout there are much larger windows filling the lower level of the home with natural light and warmth.','no'),
	(6140,'_archive_homes_feature_orientation','right','no'),
	(6141,'_archive_homes_feature_title','Your Connection To South Calgary','no'),
	(6142,'_archive_homes_feature_body','Alongside our inviting outdoor marvels, tennis courts, and neighbouring golf course, the pulse of south Calgary is less than 10 minutes away from our community. When the mood strikes, dine out at a bistro then catch a movie at the Seton Urban District, where you’ll also find ample retail (from fashion to groceries), medical services, schools, workspaces.','no'),
