	(11,1,'2018-09-19 20:12:05','2018-09-19 20:12:05','<h2><a href=\"https://stories.brookfieldresidential.com/find-your-joy-in-artesia\" target=\"_blank\" rel=\"noopener\"><img class=\"alignnone size-full wp-image-387\" src=\"https://liveinartesia.com/app/uploads/2019/05/Web-Banner_COTY18.jpg\" alt=\"\" width=\"1200\" height=\"356\" />\r\n</a>you’re a natural (but you worked for it)</h2>\r\nYour home is your statement of who you are—your history, your future, your lifelong passions. In Artesia, south Calgary’s unrivalled estate-only community, your personal space receives the sanctuary it deserves. Our beautifully proportioned homes overlook waterways and rolling green space to create your very own hideaway—one that’s immersed in nature, yet less than 10 minutes away from the exciting Seton Urban District.\r\n<h3>Your everyday <em>masterpiece</em></h3>','Home','','publish','closed','closed','','home','','','2019-05-14 22:37:50','2019-05-14 22:37:50','',0,'http://alberta.brookfieldresidential.com/calgary/artesia/?page_id=11',0,'page','',0),
	(12,1,'2018-09-19 20:12:05','2018-09-19 20:12:05','','Home','','inherit','closed','closed','','11-revision-v1','','','2018-09-19 20:12:05','2018-09-19 20:12:05','',11,'http://alberta.brookfieldresidential.com/calgary/artesia/?p=12',0,'revision','',0),
	(13,1,'2018-10-01 17:30:07','2018-10-01 17:30:07','<h2>Luxurious Living</h2>\r\nThis bungalow is designed for luxurious living filled with modern conveniences. The mudroom connects to the kitchen via the pantry and to the master suite through the laundry area, making it easy to move about the space. The kitchen, nook and great room and are open and ideal for entertaining.','Brookfield Residential','','publish','closed','closed','','brookfield-residential','','','2019-01-02 20:20:36','2019-01-02 20:20:36','',0,'http://alberta.brookfieldresidential.com/calgary/artesia/?post_type=homes&#038;p=13',0,'homes','',0),
	(21,1,'2018-09-25 16:09:17','2018-09-25 16:09:17','<h2>your perfect balance</h2>\r\nYour home is your statement of who you are—your history, your future, your lifelong passions. In Artesia, south Calgary’s unrivaled estate-only community, your personal space receives the sanctuary it deserves. Our beautifully proportioned homes overlook waterways and rolling green space to create your very own hideaway—one that’s immersed in nature, yet less than 10 minutes away from the exciting Seton Urban District.','Lifestyle','','publish','closed','closed','','lifestyle','','','2019-05-14 22:38:21','2019-05-14 22:38:21','',0,'http://alberta.brookfieldresidential.com/calgary/artesia/?page_id=21',0,'page','',0),
	(22,1,'2018-09-25 16:09:17','2018-09-25 16:09:17','','Lifestyle','','inherit','closed','closed','','21-revision-v1','','','2018-09-25 16:09:17','2018-09-25 16:09:17','',21,'http://alberta.brookfieldresidential.com/calgary/artesia/21-revision-v1/',0,'revision','',0),
	(23,1,'2018-09-25 16:09:41','2018-09-25 16:09:41','<h2>Life without Compromise</h2>\r\nWhile Artesia at Heritage Pointe feels away from it all, it really isn’t. Shopping, restaurants and the city are just minutes away. We worked hard to consciously design and preserve a balance between urban and rural, where you can retreat to the country or revel in the city.\r\n\r\n&nbsp;\r\n\r\n<strong>Here are just some of the amenities nearby:</strong>\r\n<ul>\r\n 	<li>Seton shopping district</li>\r\n 	<li>Seton leisure centre</li>\r\n 	<li>South Health Campus</li>\r\n 	<li>Heritage Pointe Golf Club</li>\r\n 	<li>Heritage Pointe Village Centre</li>\r\n 	<li>Bow River nature area</li>\r\n 	<li>Nearby schools</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<img class=\"alignnone size-full wp-image-95\" src=\"https://liveinartesia.com/app/uploads/2018/10/amenity-map.svg\" alt=\"\" />\r\n<h3></h3>\r\n<h3>We want to hear from you</h3>\r\nGet in touch to learn more about this exclusive estate-only community.\r\n\r\n<a class=\"button\" href=\"/contact/\">Contact</a>','Location','','publish','closed','closed','','location','','','2019-05-14 22:36:31','2019-05-14 22:36:31','',0,'http://alberta.brookfieldresidential.com/calgary/artesia/?page_id=23',0,'page','',0),
	(24,1,'2018-09-25 16:09:41','2018-09-25 16:09:41','','Location','','inherit','closed','closed','','23-revision-v1','','','2018-09-25 16:09:41','2018-09-25 16:09:41','',23,'http://alberta.brookfieldresidential.com/calgary/artesia/23-revision-v1/',0,'revision','',0),
	(25,1,'2018-09-25 16:10:21','2018-09-25 16:10:21','<h2><span class=\"clr-gold\">THE REAL LUXURY</span> IS THE WAY IN WHICH YOU’LL LIVE</h2>\r\nLife is good. Family. Friends. A career that you love. You couldn’t ask for more, but you deserve more. You deserve to live in one of Calgary’s luxury communities. You deserve more room for the kids to roam — inside and out. More space for cocktails and canapés on a sunny, summer afternoon. A neighbourhood in the country that’s still close to the city. It’s time to have every last little thing you know you’ve earned, so we brought them all together in one place.','Why Artesia?','','publish','closed','closed','','why-artesia','','','2019-05-14 22:39:07','2019-05-14 22:39:07','',0,'http://alberta.brookfieldresidential.com/calgary/artesia/?page_id=25',0,'page','',0),
	(26,1,'2018-09-25 16:10:21','2018-09-25 16:10:21','','Why Artesia?','','inherit','closed','closed','','25-revision-v1','','','2018-09-25 16:10:21','2018-09-25 16:10:21','',25,'http://alberta.brookfieldresidential.com/calgary/artesia/25-revision-v1/',0,'revision','',0),
	(27,1,'2018-09-25 16:10:48','2018-09-25 16:10:48','<h2>Exactly what you want</h2>\r\nPeace. Privacy. A place in the countryside just close enough to the city. Welcome to Artesia: the ONLY community in south Calgary exclusively for estate homes. Finely built homes face ponds and rolling landscape, just 10 minutes from conveniences of Seton.','Contact','','publish','closed','closed','','contact','','','2019-05-14 22:37:03','2019-05-14 22:37:03','',0,'http://alberta.brookfieldresidential.com/calgary/artesia/?page_id=27',0,'page','',0),
