	(303,1,'2018-11-08 22:49:50','2018-11-08 22:49:50','<h2>Life without Compromise</h2>\r\nWhile Artesia at Heritage Pointe feels away from it all, it really isn’t. Shopping, restaurants and the city are just minutes away. We worked hard to consciously design and preserve a balance between urban and rural, where you can retreat to the country or revel in the city.\r\n\r\n&nbsp;\r\n\r\n<strong>Here are just some of the amenities nearby:</strong>\r\n<ul>\r\n 	<li>Seton shopping district</li>\r\n 	<li>Seton leisure centre</li>\r\n 	<li>South Health Campus</li>\r\n 	<li>Heritage Pointe Golf Club</li>\r\n 	<li>Heritage Pointe Village Centre</li>\r\n 	<li>Bow River nature area</li>\r\n 	<li>Nearby schools</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<img class=\"alignnone size-full wp-image-95\" src=\"http://liveinartesia.com/app/uploads/2018/10/amenity-map.svg\" alt=\"\" />\r\n<h3></h3>\r\n<h3>We want to hear from you.</h3>\r\nGet in touch to learn more about this exclusive estate-only community.\r\n\r\n<a class=\"button\" href=\"/contact\">Contact</a>','Location','','inherit','closed','closed','','23-revision-v1','','','2018-11-08 22:49:50','2018-11-08 22:49:50','',23,'https://alberta.brookfieldresidential.com/calgary/artesia/23-revision-v1/',0,'revision','',0),
	(304,1,'2018-11-08 22:50:37','2018-11-08 22:50:37','<h2>Life without Compromise</h2>\r\nWhile Artesia at Heritage Pointe feels away from it all, it really isn’t. Shopping, restaurants and the city are just minutes away. We worked hard to consciously design and preserve a balance between urban and rural, where you can retreat to the country or revel in the city.\r\n\r\n&nbsp;\r\n\r\n<strong>Here are just some of the amenities nearby:</strong>\r\n<ul>\r\n 	<li>Seton shopping district</li>\r\n 	<li>Seton leisure centre</li>\r\n 	<li>South Health Campus</li>\r\n 	<li>Heritage Pointe Golf Club</li>\r\n 	<li>Heritage Pointe Village Centre</li>\r\n 	<li>Bow River nature area</li>\r\n 	<li>Nearby schools</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<img class=\"alignnone size-full wp-image-95\" src=\"http://liveinartesia.com/app/uploads/2018/10/amenity-map.svg\" alt=\"\" />\r\n<h3></h3>\r\n<h3>We want to hear from you</h3>\r\nGet in touch to learn more about this exclusive estate-only community.\r\n\r\n<a class=\"button\" href=\"/contact\">Contact</a>','Location','','inherit','closed','closed','','23-revision-v1','','','2018-11-08 22:50:37','2018-11-08 22:50:37','',23,'https://alberta.brookfieldresidential.com/calgary/artesia/23-revision-v1/',0,'revision','',0),
	(305,1,'2018-11-08 23:01:10','2018-11-08 23:01:10','<h2>Exactly what you want</h2>\r\nPeace. Privacy. A place in the countryside just close enough to the city. Welcome to Artesia: the ONLY community in south Calgary exclusively for estate homes. Finely built homes face ponds and rolling landscape, just 10 minutes from conveniences of Seton.','Contact','','inherit','closed','closed','','27-revision-v1','','','2018-11-08 23:01:10','2018-11-08 23:01:10','',27,'https://alberta.brookfieldresidential.com/calgary/artesia/27-revision-v1/',0,'revision','',0),
	(306,1,'2018-11-08 23:03:39','2018-11-08 23:03:39','<h2>you’re a natural (but you worked for it)</h2>\r\nYour home is your statement of who you are—your history, your future, your lifelong passions. In Artesia, south Calgary’s unrivalled estate-only community, your personal space receives the sanctuary it deserves. Our beautifully proportioned homes overlook waterways and rolling green space to create your very own hideaway—one that’s immersed in nature, yet less than 10 minutes away from the exciting Seton Urban District.\r\n<h3>Your everyday <em>masterpiece</em></h3>','Home','','inherit','closed','closed','','11-revision-v1','','','2018-11-08 23:03:39','2018-11-08 23:03:39','',11,'https://alberta.brookfieldresidential.com/calgary/artesia/11-revision-v1/',0,'revision','',0),
