	(383,1,'2019-04-24 22:19:26','2019-04-24 22:19:26','<h2>Life without Compromise</h2>\r\nWhile Artesia at Heritage Pointe feels away from it all, it really isn’t. Shopping, restaurants and the city are just minutes away. We worked hard to consciously design and preserve a balance between urban and rural, where you can retreat to the country or revel in the city.\r\n\r\n&nbsp;\r\n\r\n<strong>Here are just some of the amenities nearby:</strong>\r\n<ul>\r\n 	<li>Seton shopping district</li>\r\n 	<li>Seton leisure centre</li>\r\n 	<li>South Health Campus</li>\r\n 	<li>Heritage Pointe Golf Club</li>\r\n 	<li>Heritage Pointe Village Centre</li>\r\n 	<li>Bow River nature area</li>\r\n 	<li>Nearby schools</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<img class=\"alignnone size-full wp-image-95\" src=\"https://liveinartesia.com/app/uploads/2018/10/amenity-map.svg\" alt=\"\" />\r\n<h3></h3>\r\n<h3>We want to hear from you</h3>\r\nGet in touch to learn more about this exclusive estate-only community.\r\n\r\n<a class=\"button\" href=\"/calgary/artesia/contact/\">Contact</a>','Location','','inherit','closed','closed','','23-revision-v1','','','2019-04-24 22:19:26','2019-04-24 22:19:26','',23,'https://liveinartesia.com/23-revision-v1/',0,'revision','',0),
